pragma solidity ^0.4.23;

import "./usingOraclize.sol";
import "./libraries/OraclizeQueryBuilder.sol";

/**
 * @title Pool Party Name Service
 * @dev A contract that maps Ethereum addresses to human readable internet domain names
 * @author - Rick Feiner and Shane van Coller
 */
contract PoolPartyNameService is usingOraclize {
    using OraclizeQueryBuilder for OraclizeQueryBuilder.OraclizeQueries;

    /* Constants */
    uint256 public constant VERSION = 1;
    string public constant APP_IPFS_HASH = "QmNd7C8BwUqfhfq6xyRRMzxk1v3dALQjDxwBg4yEJkU24D"; //Java app

    OraclizeQueryBuilder.OraclizeQueries oQueries;

    mapping(bytes32 => address) public hashedStringResolutions;
    mapping(address => string) public addressResolutions;
    mapping(bytes32 => string) public pendingMappings;
    mapping(bytes32 => ProofHistory[]) public proofHistories;
    mapping(bytes32=> uint256) public proofHistoryCount;

    struct ProofHistory {
        string domain;
        address ethAddress;
        bytes proof;
        uint256 proofType;
        uint256 time;
    }

    event MappingCreated(string indexed domain, address indexed ethAddress, uint256 date);

    /**
     * @dev Constructor initializing parameters
     */
    constructor() public {
    }

    /**
     * @dev Oraclize call to verify a domain using hosted JSON file
     * @param _domainRoot Root domain
     * @param _useWww Whether or not to use www subdomain for the call to Oraclize
     */
    function mapDomainFromJson(string _domainRoot, bool _useWww)
        public
        payable
    {
        require(oraclize_getPrice("URL") <= address(this).balance, "Insufficient funds to call Oraclize");

        oraclize_setProof(proofType_TLSNotary | proofStorage_IPFS);
        oQueries.buildQueries(_domainRoot, _useWww);
        bytes32 _oraclizeQueryId = oraclize_query("URL", oQueries.oraclizeQueryETHAddress, 300000);

        pendingMappings[_oraclizeQueryId] = _domainRoot;
    }

    /**
     * @dev Oraclize call to verify a domain using TXT records
     * @param _domainRoot Root domain
     */
    function mapDomainFromTxtRecord(string _domainRoot)
        public
        payable
    {
        require(oraclize_getPrice("computation") <= address(this).balance, "Insufficient funds to call Oraclize");

        oraclize_setProof(proofType_TLSNotary | proofStorage_IPFS);
        bytes32 _oraclizeQueryId = oraclize_query("computation", [APP_IPFS_HASH, _domainRoot], 300000);

        pendingMappings[_oraclizeQueryId] = _domainRoot;
    }

    /**
     * @dev Oraclize callback - assume the result is always an address no matter which method (URL or Computation) was used to get it. Tx will fail if returned value is not an address
     * @param _qId ID used to tie result back to the original query
     * @param _result Result of the oracle query
     */
    function __callback(bytes32 _qId, string _result, bytes _proof) public {
        require(msg.sender == oraclize_cbAddress(), "Unauthorized caller");

        string memory _domain = pendingMappings[_qId];

        //This oraclize call is no longer pending
        pendingMappings[_qId] = "";
        address _ethAddress = parseAddr(_result);

        require (bytes(_domain).length > 0, "Unknown domain");
        require (_ethAddress != address(0x0), "No address for given domain");

        //Add a historical record of the change
        proofHistories[keccak256(_domain)].push(ProofHistory({domain:_domain, ethAddress: _ethAddress, proof:_proof, proofType:0, time:now}));
        proofHistoryCount[keccak256(_domain)] += 1;

        //Create the mapping
        hashedStringResolutions[keccak256(_domain)] = _ethAddress;
        //TODO: We can map one address to multiple domains -- is this reverse lookup even meaningful?
        addressResolutions[_ethAddress] = _domain;

        emit MappingCreated(_domain, _ethAddress, now);
    }

    /**
     * @dev Solidity cannot return complex types, so this is a custom getter for proofHistories for a specific domain at a specific index.
     * @param _domain The domain to lookup
     * @param _index The index in the array to retrieve
     */
    function getProofHistory(bytes32 _domain, uint256 _index)
        public
        view
        returns (string, address, bytes, uint256, uint256)
    {
        return (
            proofHistories[_domain][_index].domain,
            proofHistories[_domain][_index].ethAddress,
            proofHistories[_domain][_index].proof,
            proofHistories[_domain][_index].proofType,
            proofHistories[_domain][_index].time
        );
    }
}

